There’s something so beautiful about carrying a little bit of home with you… like a feeling that grounds you no matter where life takes you. 
For me, that magic is Madurai jasmine.
It’s everything I dreamed it would be… delicate, powerful, nostalgic. A reminder of who I am and where I come from.

Lately, I’ve been thinking a lot about alignment, that rare moment when passion, purpose, and the right people all come together. It doesn’t happen often, and when it does, it’s magic. 
I feel that alignment now. And I don’t take it for granted.
This feels like just the beginning of something bigger. Something built with care, with intention, and with love.
When every product, every idea, every decision is made with that kind of intention, the sky isn’t the limit. It’s just the starting line.

So here we are.
Time to rise and bloody shine. 🌸

